Jerry White's association with Luthor is presented from the points of view of Jimmy Olsen, Lois Lane, Perry White, Jose Delgado and Luthor himself in &quot;Gangwar Part Two: a tragedy in five acts&quot;. Part 2 of 3, continued from the previous issue. Story continues next issue.

